import React from 'react'
import { CDBFooter } from 'cdbreact';

function Footer() {
  return (
        <CDBFooter className='shadow'>
            <footer className="ml-4 h5 mb-0 font-weight-bold bg-gray-200 text-center text-xs p-3 absolute bottom-0 w-full">
                Copyright Â© 2022 Flight Try. All Rights Reserved.
            </footer>
        </CDBFooter>
  )
}

export default Footer
